const Custos = ({ notas }) => {
  return (
    <div>
      {notas.map((nota) => {
        return (
          <p>
            {nota.corretora}
            {nota.data}
            {nota.folha}
            {nota.Custos}
          </p>
        );
      })}
      )
    </div>
  );
};

export default Custos;
